tish Columbia, Canada, with programming serving the Sunshine Coast and the Sea-to-Sky corridor. Capilano University is enabled by theUniversity Act,[4] enrolling its first students in 1968. The school was established by local school boards and residents of the North Shore and Howe Sound on the need for a public institution serving the local communities. ', 'Initial enrollment was 784 students in 1968,[1] and as of 2016, has grown to enroll approximately 11,600 students per year.[3] Under the direction of its then president, Greg Lee, Capilano University was re-designated from a community college to a university, in 2008.[5] Capilano University\'s academic offerings include liberal arts, professional and career programs, leading to certificates, diplomas and degrees at the primarily undergraduate level.')
